import {DepositsList, DepositItem} from '../interfaces/interfaces'
export const findIndexInDepositsList: Function = (list: DepositsList, code: string): number => {
  return list.deposits.findIndex((deposit: DepositItem) => deposit.code === formValues.code)
}
